import Header from "./Components/Header.js";
import { link } from 'react-router-dom'
import './App.css';

function App() {
  return (
    <div className="App">
      <Header /> 
      <h2>Bounties</h2>
      <ul>
      <link to={"./"}>
      <li>Bounties</li>
      </link>
      </ul>

    </div>
  );
}

export default App;
